import logImg from "../images/Vector.svg";

function Header() {
  return (
    <header className="header header_opacity">
      <img
        className="header__logo"
        src={logImg}
        require="true"
        alt="логотип-место"
      />
      <p className="header-text">Войти</p>
    </header>
  );
}

export default Header;
